import './blog.css';

const Blog = () => {
	return (
		<div className="omntech__blog section__padding" id="blog">
			<div className="omntech__blog-heading">
				<h1 className="gradient__text">A lot is happening, 
We are blogging about it.</h1>
			</div>
		</div>
	)
}

export default Blog
